window.bookSummaryJSON = "<p>As the only male demigod of his generation, Cameron has some pretty big...shoes to fill.</p> <p>For one, he has to deal with all the female demigods, and some of them, well... you know.</p> <p>For two, he’s the best blacksmith the demigods have seen in a millennia, which is good because apparently, he’s destined to craft the Ultimate Weapon.</p> <p>So, yeah, this book is about a dude who likes to forge things and is surrounded by hot demigoddesses.</p> <p>Do the math.</p>"; 
